import React from 'react';
import { Route, Navigate } from 'react-router-dom';
import { useCookies } from 'react-cookie'; // Importar a biblioteca react-cookie

const ProtectedRoute = ({ path, element }) => {
  const [cookies] = useCookies(); // Usar o hook useCookies para acessar os cookies

  const isAuthenticated = cookies.jwtToken; // Obter o token JWT dos cookies

  return isAuthenticated ? (
    <Route path={path} element={element} />
  ) : (
    <Navigate to="/login" replace={true} />
  );
};

export default ProtectedRoute;
